cktesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"814646","type":"CustomJS"},{"attributes":{"source":{"id":"814258"}},"id":"814591","type":"CDSView"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"814243","type":"WheelZoomTool"},{"attributes":{"coordinates":null,"data_source":{"id":"814258"},"glyph":{"id":"814606"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"814608"},"nonselection_glyph":{"id":"814607"},"view":{"id":"814610"}},"id":"814609","type":"GlyphRenderer"},{"attributes":{"coordinates":null,"data_source":{"id":"814258"},"glyph":{"id":"814306"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"814308"},"nonselection_glyph":{"id":"814307"},"view":{"id":"814310"}},"id":"814309","type":"GlyphRenderer"},{"attributes":{"border_line_color":"#333333","click_policy":"hide","coordinates":null,"group":null,"items":[{"id":"814604"},{"id":"814622"},{"id":"814641"}],"label_text_font_size":"8pt","location":"top_left","margin":0,"padding":5,"spacing":0},"id":"814603","type":"Legend"},{"attributes":{},"id":"814712","type":"AllLabels"},{"attributes":{"overlay":{"id":"814435"}},"id":"814430","t
